import React, { useState } from 'react';
import axios from 'axios';
import './Register.css'

const jobTitles = [
    'CEO',
    'CFO',
    'COO',
    'CTO',
    'CIO',
    'VICE_PRESIDENT',
    'SENIOR_MANAGER',
    'MANAGER',
    'TEAM_LEAD',
    'SOFTWARE_ENGINEER',
    'JUNIOR_ENGINEER',
    'INTERN'
];

const Register = () => {
    const [firstname, setFirstname] = useState('');
    const [lastname, setLastname] = useState('');
    const [username, setUsername] = useState('');
    const [jobTitle, setJobTitle] = useState('');
    const [mobile, setMobile] = useState('');
    const [location, setLocation] = useState('');
    const [password, setPassword] = useState('');
    // const [reEnterPassword, setReEnterPassword] = useState('');
    const [message, setMessage] = useState('');



    const handleRegister = async (event) => {

        event.preventDefault();
        // if (password !== reEnterPassword) {
        //     setMessage('Passwords do not match.');
        //     return;
        // }
        if (!firstname.trim() || !lastname.trim() || !username.trim()) {
            setMessage('Please fill in all required fields.');
            return;
        }

        // Password validation criteria
        const passwordRegex = /^(?=.[A-Z])(?=.\d)(?=.[!@#$%^&])[A-Za-z\d!@#$%^&*]{8,}$/;

        if (!passwordRegex.test(password)) {
            setMessage('Password must be at least 8 characters long, contain an uppercase letter, a number, and a special character.');
            return;
        }

        try {
            const response = await axios.post('http://localhost:8081/api/register', {
                firstname,
                lastname,
                username,
                jobTitle,
                mobile,
                location,
                password,
                message
            });
            setMessage(response.data.message);
        } catch (error) {
            setMessage('Error registering user.');
        }
    };

    return (

        <div className="main">


            <h2 className="header">Register</h2>
            <label> Enter Firstname</label>
            <input
                type="text"
                placeholder="firstname"
                value={firstname} required
                onChange={(e) => setFirstname(e.target.value)}
                className="input"
            />

            <label > Enter Lastname</label>
            <input
                type="text"
                placeholder="lastname"
                value={lastname} required
                onChange={(e) => setLastname(e.target.value)}
                className="input"
            />

            <label className='text-start '> Enter Username</label>
            <input
                type="text"
                placeholder="username"
                value={username} required
                onChange={(e) => setUsername(e.target.value)}
                className="input"
            />

            <label htmlFor="jobTitle" className="text-start">Job Title:</label>
            <select
                id="jobTitle"
                value={jobTitle}
                onChange={(e) => setJobTitle(e.target.value)}
                className="input"
            >
                <option value="" disabled>Select a job title</option>
                {jobTitles.map((title, index) => (
                    <option key={index} value={title}>
                        {title}
                    </option>
                ))}
            </select>

            <label>Mobile number</label>
            <input
                type="number"
                placeholder="Enter mobile number"
                value={mobile} required
                onChange={(e) => setMobile(e.target.value)}
                className="input"
            />

            <label>Location</label>
            <input
                type="text"
                placeholder="Enter Current location"
                value={location} required
                onChange={(e) => setLocation(e.target.value)}
                className="input"
            />

            <label>password</label>
            <input
                type="password"
                placeholder="Password"
                value={password} required
                onChange={(e) => setPassword(e.target.value)}
                className="input"
            />

            <button
                onClick={handleRegister}
                className="btn"
            >
                Register
            </button>
            {message && <p className="message">{message}</p>}



            <span className="text-sm">
                Already have an account?{' '}
                <a
                    href="/login " // Link to the login page
                    className="text-blue-500 hover:text-blue-600"
                >
                    Login
                </a>
            </span>
        </div>






    );
};

export default Register;
